import './App.css';
import React from "react";
import {
	BrowserRouter as Router,
	Switch,
	Route,
	Redirect,
} from "react-router-dom";

import homePage from "./pages/HomePage.js"
const App = ()=> {
  return (
  <Router>
    <App />
  <Switch>
    <Route exact path="/" page={"home"} component={homePage} />
    <Redirect to="/" /> {/* Path not matched */}
  </Switch>
</Router>
)
}

export default App;
